import React from 'react';

export default function LeftSidebar({ onSelectHome, onSelectNetwork }) {
  return (
    <nav>
      <div
        style={{ cursor: 'pointer', marginBottom: '1rem' }}
        onClick={onSelectHome}
      >
        Home
      </div>
      <div
        style={{ cursor: 'pointer', marginBottom: '1rem' }}
        onClick={onSelectNetwork}
      >
        Network Map
      </div>
    </nav>
  );
}
